member.summary:
 Calculates the factors of a given number.



Example:

             using Numbers.Utils.Operations;

             var factors = FactorUtils.Factor(60)
             Console.WriteLine($"[{string.Join(", ", factors)}]");



Output:

             [1, 2, 3, 4, 5, 6, 10, 12, 15, 20, 30, 60]
